const Header = (props) => {
  return (
    <h1>{props.name}</h1>
  )
  }

const Content = (props) => {
  return (
    <div>
      <Part part={props.part} excersice={props.excersice} />
    </div>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.excersice1 + props.excersice2 + props.excersice3}</p>
  )
}

const Part = (props) => {
  return (
    <p>{props.part} {props.excersice}</p>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header name={course} />
      <Content part={part1} excersice={exercises1} />
      <Content part={part2} excersice={exercises2} />
      <Content part={part3} excersice={exercises3} />
      <Total excersice1={exercises1} excersice2={exercises2} excersice3={exercises3} />
    </div>
  )
}

export default App
